PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE clientes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    nombre TEXT NOT NULL UNIQUE,
    direccion TEXT,
    telefono TEXT,
    email TEXT,
    contacto_principal TEXT,
    notas TEXT
);
CREATE TABLE logs_propuesta (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        id_propuesta TEXT NOT NULL,
        campo TEXT NOT NULL,
        valor_anterior TEXT,
        valor_nuevo TEXT,
        fecha TEXT NOT NULL,
        usuario TEXT NOT NULL
    );
CREATE TABLE usuarios (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            nombre TEXT NOT NULL,
            email TEXT NOT NULL UNIQUE,
            password TEXT NOT NULL,
            rol TEXT NOT NULL CHECK (
                rol IN ('administrador', 'gerente', 'director', 'account_manager', 'preventa', 'gestor')
            ),
            activo INTEGER NOT NULL DEFAULT 1
        , ultima_actualizacion_password TEXT, password_anterior TEXT);
CREATE TABLE ordenes_compra (
                id_oc INTEGER PRIMARY KEY AUTOINCREMENT,
                id_propuesta TEXT NOT NULL,
                nro_oc TEXT NOT NULL,
                fecha_oc DATE NOT NULL,
                monto_oc REAL NOT NULL CHECK (monto_oc > 0),
                pm_asignado TEXT,
                moneda TEXT NOT NULL CHECK(moneda IN ('S/', 'US$'))
            );
CREATE TABLE propuestas (
    id TEXT PRIMARY KEY,
    nro_antiguo TEXT,
    fecha_solicitud DATE,
    fecha_actualizacion DATE,
    cliente TEXT,
    cliente_final TEXT,
    nombre_oportunidad TEXT,
    account_manager TEXT,
    contacto_cliente TEXT,
    preventa_asignado TEXT,
    probabilidad_cierre REAL,
    status TEXT,
    cierre_soles REAL,
    cierre_dolares REAL,
    comentarios TEXT
);
CREATE TABLE facturas (
    id_factura INTEGER PRIMARY KEY AUTOINCREMENT,
    id_oc INTEGER NOT NULL,
    nro_factura TEXT NOT NULL,
    monto_factura_soles REAL,
    monto_factura_dolares REAL,
    fecha_factura DATE NOT NULL
);
DELETE FROM sqlite_sequence;
COMMIT;
